import React from 'react'
import './Footer.scss';

const Footer = () => {
  return (
    <footer className='footer'>
        <p>CANAPÉ</p>
        <p>A canapé is a type of hors d'oeuvre, a small, prepared and
            usually decorative food, held in the fingers and often eaten in 
            one bite</p>
    </footer>
  )
}

export default Footer
